import React from 'react';
import { AppBar, Toolbar, Typography } from '@mui/material'; // immer @mui zum importieren nehmen kp warum 
import { styled } from '@mui/system';



const Root = styled(( theme ) => ({   
        logoLg: { 
            display: "none",
            [theme.breakpoints.up("sm")]: {
                display: "block",
            }
        },
        logoSm: {  
            display: "block",
            [theme.breakpoints.up("sm")]: {
            display: "none",
        },
        },
    }));




export default function Navbar() {

    return (
        <Root>
            <AppBar>
                <Toolbar>
                    <Typography variant="h6" className={classes.logoLg} >
                        Modern Timber Engineering
                    </Typography>
                    <Typography variant="h6" className={classes.logoSm} >
                        MTE
                    </Typography>
                </Toolbar>
            </AppBar>
        </Root>
    );
};
